import s from './Friends.module.css'
import Friend from "./Friend/Friend";

let friend = [
    {name: 'Arman', id: 1},
    {name: 'Nurik', id: 2},
    {name: 'Madya', id: 3},
    {name: 'Damik', id: 4},
    {name: 'Sam', id: 5},
]
const Friends = () => {
    return (
        <div className={s.items}>
            <Friend name={friend.name[0]} id={'1'}/>
            <Friend name={'Nurik'} id={'2'}/>
            <Friend name={'Madya'} id={'3'}/>
            <Friend name={'Damik'} id={'4'}/>
            <Friend name={'Sam'} id={'5'}/>
        </div>
    );
};

export default Friends;
